import '../DashBoard/DashBoard.css'

function DashBoard(){
    return(
        <div className='outerBox'>
        <div className="Column">
            <div className="messageBox">
                <div className="speech-bubble"></div>
            </div>
        </div>
    </div>
    );
}

export default DashBoard;
